// the vera font structure
Font vera_font = {
    // OpenVG font object
    VG_INVALID_HANDLE,
    // "character code" to "glyph index" map, sorted by ascending character codes
    NULL,
    // number of entries within the character codes map
    0,
    // glyphs data (entries are sorted by ascending glyph index)
    vera_glyphs,
    // number of glyphs
    95,
    // kerning table
    vera_kerning_table,
    // number of kerning entries
    220
};

// initialize vera font
VGErrorCode veraFontInit(void) {

    VGErrorCode err = VG_NO_ERROR;
    const VGfloat vera_glyphs_origin[2] = { 0.0f, 0.0f };

    if (vera_font.openvgHandle == VG_INVALID_HANDLE) {
        // create OpenVG font object
        vera_font.openvgHandle = vgCreateFont(vera_font.glyphsCount);
        if (vera_font.openvgHandle != VG_INVALID_HANDLE) {
            VGuint i;
            // create OpenVG glyphs
            for (i = 0; i < vera_font.glyphsCount; ++i) {
                VGPath path = vgCreatePath(VG_PATH_FORMAT_STANDARD, VG_PATH_DATATYPE_F, 1.0f, 0.0f, vera_font.glyphs[i].commandsCount, vera_font.glyphs[i].coordinatesCount, VG_PATH_CAPABILITY_ALL);
                vgAppendPathData(path, vera_font.glyphs[i].commandsCount, vera_font.glyphs[i].commands, vera_font.glyphs[i].coordinates);
                // remove "editing" capabilities, so that OpenVG driver can try to free some memory
                vgRemovePathCapabilities(path, VG_PATH_CAPABILITY_APPEND_FROM | VG_PATH_CAPABILITY_APPEND_TO |
                                               VG_PATH_CAPABILITY_MODIFY | VG_PATH_CAPABILITY_TRANSFORM_FROM |
                                               VG_PATH_CAPABILITY_TRANSFORM_TO | VG_PATH_CAPABILITY_INTERPOLATE_FROM |
                                               VG_PATH_CAPABILITY_INTERPOLATE_TO);
                vgSetGlyphToPath(vera_font.openvgHandle, vera_font.glyphs[i].glyphIndex, path, VG_FALSE, vera_glyphs_origin, vera_font.glyphs[i].escapement);
                vgDestroyPath(path);
            }
        }
        // check for errors from the OpenVG driver side
        err = vgGetError();
    }

    return err;
}

// destroy vera font
void veraFontDestroy(void) {

    vgDestroyFont(vera_font.openvgHandle);
}

